// import { Link } from "react-router-dom";
import {AiOutlineShoppingCart} from '@react-icons/all-files/ai/AiOutlineShoppingCart';

const mouseOver = (target) => {
    target = target.tagName === "span" ? target : target.closest("span");
    const child = target.child;
    child.style.color = "#E9497E";
    child.style.transition = "0.5s";
};

const mouseOut = (target) => {
    target = target.tagName === "span" ? target : target.closest("span");
    const child = target.child;
    child.style.color = "rgb(25, 25, 25)";
    child.style.transition = "0.5s";
};

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="navbar-logo">
                <img src="logo.png" alt="benefit logo" />
            </div>
            <div className="links">
                <div className="nav-link">Home</div>
                <div className="nav-link">Products</div>
                <div className="nav-link">Services</div>
                <div className="nav-link">Blog</div>
            </div>
            <span class="click-icon cart" 
             onMouseOver={({target})=> mouseOver(target)}
             onMouseOut={({target})=> mouseOut(target)}
            ><AiOutlineShoppingCart /></span>
        </div>
    )
}

export default Navbar;
